import React from "react";

import CardPublications from "./CardPublications";
import PublicationsData from "./PublicationsData";

import "./Publications.css";
import "../../App.css";

const research =
  "https://img.icons8.com/external-flaticons-flat-flat-icons/64/000000/external-research-university-flaticons-flat-flat-icons-3.png";

const Publications = () => {
  return (
    <>
      <section className="research" id="research">
        <div className="content-section mtop d_flex research_box">
          <div className="heading">
            <h1>Research</h1>
            <img src={research} alt="" />
          </div>
          <div className="content">
            {PublicationsData.map((val, index) => {
              return (
                <CardPublications
                  key={index}
                  conference={val.conference}
                  title={val.title}
                  link={val.researchGateLink}
                />
              );
            })}
          </div>
        </div>
      </section>
    </>
  );
};

export default Publications;
